load tablet.txt;load quadric.txt;load rosenbrock.txt;load griewank.txt;load rastrigin.txt;load schaffer.txt;y1 = tablet(1:1000, 2);y2 = quadric(1:1000, 2);y3 = rosenbrock(1:1000, 2);y4 = griewank(1:1000, 2);y5 = rastrigin(1:1000, 2);y6 = schaffer(1:1000, 2);plot(y1, 'y');hold on;plot(y2, 'm');hold on;plot(y3, 'c');hold on;plot(y4, 'r');hold on;plot(y5, 'b');hold on;plot(y6, 'k');hold on;legend('tablet', 'quadric', 'rosenbrock', 'griewank', 'rastrigin', 'schaffer');xlabel('iteration');ylabel('log(fitness)');